import './App.css';
import "openbridge-web-components";

function App() {
  return (
    <div className="App">
      <html lang="en" theme="day">
        <head>
          <script src="https://unpkg.com/openbridge-web-components@0.2.1"></script> 
          <link rel="stylesheet" href="https://unpkg.com/openbridge-css@0.2.1/dist/css/openbridge.css"></link>
        </head>
        <body>
          <ob-azimuth-large target="90" value = "80" angle = "50" targetAngle="60"/>
        </body>
      </html>
    </div>
  );
}

export default App;
